import styled from "styled-components";
import { Icon, Heading } from "../components";

const User_Overview = ({ name, players = [] }) => {
  return (
    <div className="Dash_Overview">
      <span>
        <Heading type="Small">{name}</Heading>
      </span>
      {/* <Line type="Vertical" /> */}
      <span>
        {players.map(({ sport, name: n }) => (
          <>
            <Heading type="Sub">{n}</Heading>
            <Icon type={sport} />
          </>
        ))}
      </span>
    </div>
  );
};

export default User_Overview;
